import React from 'react';


export default function Table ({ data, setSortBy }) {
  const columns = [
    { title: 'in_frame' },
    { title: 'out_frame' },
    { title: 'value' },
    { title: 'labels' },
    { title: 'location' },
  ];

  const tbody = (
    <tbody>
        {data && data.map(({
          in_frame,
          out_frame,
          content,
        }) => (
          <tr>
            <td>{in_frame}</td>
            <td>{out_frame}</td>
            <td>
              <ul>
                {content.value.map((value) => (
                  <li>{value}</li>
                ))}
              </ul>
            </td>
            <td>
              <ul>
                {content.labels.map((label) => (
                  <li>{label}</li>
                ))}
              </ul>
            </td>
            <td>
              <ul>
                {content.location.map((location) => (
                  <li>{location}</li>
                ))}
              </ul>
            </td>
          </tr>
        ))}
      </tbody>
  );

  return (
    <table>
      <caption>Graphics Markup Data</caption>
      <thead>
        <tr>
          {
            columns.map(({ title }) => {
              if (title === 'in_frame' || title === 'out_frame') {
                return <th onClick={() => setSortBy(title)}>{title}</th>
              }

              return <th>{title}</th>
            })
          }
        </tr>
      </thead>
      {data && tbody}
    </table>
  );
}
